unsigned char rbf_load_fpga(unsigned int uiTimeOut)
{
	unsigned int	uiTime = 0;
	unsigned char	uchPin = 0;
	unsigned int	ui = 0;


	fpga_set_pin_Dclk(0);
	fpga_set_pin_Data0(0);

	fpga_set_pin_nConfig(0);

	uiTime = 0;
	uchPin = fpga_get_pin_nStatus();
	while (uchPin != 0)
	{
		uchPin = fpga_get_pin_nStatus();
		uiTime += 1;

		if (uiTime > uiTimeOut)
		{
			return 1;
		}
	}

	fpga_set_pin_nConfig(1);

	uiTime = 0;
	uchPin = fpga_get_pin_nStatus();
	while (uchPin == 0)
	{
		uchPin = fpga_get_pin_nStatus();
		uiTime += 1;

		if (uiTime > uiTimeOut)
		{
			return 2;
		}
	}

	for (ui = 0; ui < sizeof(uchRbf); ui++)
	{
		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x01 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x02 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x04 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x08 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x10 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x20 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x40 ) != 0x00 );
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0( ( uchRbf[ui] & 0x80 ) != 0x00 );
		fpga_set_pin_Dclk(1);
	}


		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0(0);
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0(0);
		fpga_set_pin_Dclk(1);

		fpga_set_pin_Dclk(0);
		fpga_set_pin_Data0(0);
		fpga_set_pin_Dclk(1);
		fpga_set_pin_Dclk(0);

	uiTime = 0;
	uchPin = fpga_get_pin_ConfDone();
	while (uchPin == 0)
	{
		uchPin = fpga_get_pin_ConfDone();
		uiTime += 1;

		if (uiTime > uiTimeOut)
		{
			return 3;
		}
	}

	return 0;
}

